/* eslint-disable react/react-in-jsx-scope */
/* eslint-disable require-jsdoc */
import Link from 'next/link';

const linkStyle = {
    marginRight: 15,
};

const Header = (): JSX.Element => {
    return (
        <div>
            <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/new">
                <a style={linkStyle}>New Post</a>
            </Link>
        </div>
    );
};

export default Header;
